  // "productName": "Apple Iphone3",
  // "productPrice": 70000,
  // "productQuantity": 1,
  // "buyerAddress": "cj addr",
  // "city": "cj city",
  // "buyerState": "cj state",
  // "pincode": "12345",
  // "country": "cj country",
  // "mobile": "12345",
  // "email": "cj@cj.com",
  // "deliverCharge": 332,
  render() {
    return (
      <tr>
        <td>{this.props.obj.name}</td>
        <td>{this.props.obj.name}</td>
        <td>{this.props.obj.brand}</td>

        <td>{this.props.obj.currency + " " + this.props.obj.price}</td>
        <td>
          <MdOutlineDeleteOutline
            size={20}
            onClick={() => {
              console.log(this.props.obj.name);
              // {this.DeleteOrders}
              alert("Deleting Item:" + this.props.obj.name);
            }}
          />
        </td>
      </tr>
    );
  }
}
export default OrdersTable;
